CREATE TABLE IF NOT EXISTS `stacje` (
  `id` INTEGER PRIMARY KEY AUTOINCREMENT,
  `name` VARCHAR(50)
);

CREATE TABLE IF NOT EXISTS `pomiar` (
  `id` INTEGER PRIMARY KEY AUTOINCREMENT,
  `station_id` BIGINT NOT NULL,
  `data_pomiaru` DATE NOT NULL,
  `godzina_pomiaru` INT NOT NULL,
  FOREIGN KEY (`station_id`) REFERENCES `stacje` (`id`)
);

CREATE TABLE IF NOT EXISTS `wartosci` (
  `id` INTEGER PRIMARY KEY AUTOINCREMENT,
  `pomiar_id` BIGINT NOT NULL,
  `typ_pomiaru` VARCHAR(30) NOT NULL,
  `wartosc` DECIMAL(8,3) NOT NULL,
  `jednostka` VARCHAR(10),
  FOREIGN KEY (`pomiar_id`) REFERENCES `pomiar` (`id`)
);



